B.a4z=new A.n8("Ezzycare","assets/images/ezzycare-banner.webp","Connecting with nearby doctors, nurses, and labs for easy healthcare.","Ezzycare revolutionizes healthcare by connecting users with nearby medical professionals, including doctors, nurses, and laboratories. Users can effortlessly schedule appointments, perform lab tests, and order medications through the app. With its user-friendly interface, Ezzycare aims to make healthcare accessible and convenient for everyone. Key features include real-time appointment booking, digital prescription management, and secure medical records storage.",B.Tc,B.W_)
B.a4D=new A.n8("EgeMoney","assets/images/ege-money-banner.webp","A comprehensive platform for buying, selling, and trading cryptocurrencies.","EgeMoney is an intuitive cryptocurrency trading platform designed to cater to both novice and experienced traders. The app provides comprehensive market analysis, real-time price tracking, and secure trading mechanisms. EgeMoney also offers educational resources, expert trading tips, and portfolio management tools to help users make informed trading decisions. The platform's robust security features  ensure that all transactions are safe and secure.",B.bp,B.bp)
B.a4A=new A.n8("Shnatter","assets/images/shnatter-banner.webp","Web3 based first social media platform for Jewish people and friends.","Shnatter is a dedicated social media platform that serves the Jewish community, providing a safe space for users to connect and interact. The app features community forums, event planning tools, and private messaging capabilities, allowing users to share experiences, plan community events, and maintain personal connections. Shnatter is designed to foster a sense of community and belonging, with customizable privacy settings to ensure user safety and confidentiality.",B.bp,B.bp)
B.a4C=new A.n8("Primopay","assets/images/primopay-banner.webp","One stop wallet based solution for merchant payments.","Primopay is a comprehensive wallet-based payment solution tailored for merchants. The app supports a variety of payment methods, including credit cards, digital wallets, and bank transfers. It offers real-time transaction tracking, detailed financial reporting, and seamless integration with existing point-of-sale (POS) systems. Primopay's secure and user-friendly interface ensures a smooth payment experience for both merchants and customers, enhancing overall operational efficiency.",B.bp,B.bp)
B.a4B=new A.n8("Now-App","assets/images/now-app-banner.webp","Make self-govern easier.","Now-App is a powerful tool for community self-governance, designed to facilitate organization, communication, and participation. The app enables users to manage community projects, plan events, and communicate effectively with other members. Features include event scheduling, task assignments, and  community polling, all aimed at streamlining the decision-making process. Now-App empowers communities to  self-govern efficiently, fostering collaboration and active participation among members.",B.bp,B.bp)
